import React from 'react';

import classes from './BasketItem.module.css';

function BasketItem() {

  return (
    <div className={bascketIsActive ? classes.bascket__wrapper + " " + classes.active : classes.bascket__wrapper}>
      <svg role="presentation" className={classes.bascket__cross} width="23px" height="23px" viewBox="0 0 23 23" version="1.1" xmlns="http://www.w3.org/2000/svg"><g stroke="none" stroke-width="1" fill="#000" fill-rule="evenodd"><rect transform="translate(11.313708, 11.313708) rotate(-45.000000) translate(-11.313708, -11.313708) " x="10.3137085" y="-3.6862915" width="2" height="30"></rect><rect transform="translate(11.313708, 11.313708) rotate(-315.000000) translate(-11.313708, -11.313708) " x="10.3137085" y="-3.6862915" width="2" height="30"></rect></g></svg>
      <h1 className={classes.bascket__title}>Ваш заказ</h1>
      <div className={classes.bascket__line}></div>
      {/* <BascketItem /> */}
      {/* <div className={classes.bascket__line}></div> */}
      <p className={classes.bascket__price}>Сумма: {generalPrice} р.</p>
      <div className={classes.bascket__btn}>Checkout</div>
    </div>
  );
}

export default BasketItem;
